import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Cincinnati4kDrone from '../img/Cincinnati4KDrone.mp4';
import { Player } from 'video-react';

class Home extends Component{
    render() {
      return (
      <div className="home-container">
        <div className="video-container">
          <div className="video-container-sub">
            <video autoplay loop muted id="video-bg">
              <source src={Cincinnati4kDrone} type="video/mp4"></source>
            </video>
            <Player 
            playsInline
            ref={(player) => { this.player = player }}>
  <source src="../img/Cincinnati4KDrone.mp4" />
</Player>
          </div>
        </div>
          <div className='post card'>
            {/* <img src={_} alt="Logo" /> */}
            <div className="card-content">
              <Link to={'_'}>
                <span className='card-title red-text'>Help</span>
              </Link>
              <p>Help</p>
            </div>
          </div>
      </div>
      )
    }    
}

export default (Home)
